INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10004, "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね", 0.0, "2023/06/30 12:00:00", 1, 126501, "2023/09/22 14:59:59", -470.0, 2, 2002, 1, 0.0, 1, "ライラエル");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10005, "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", 0.0, "2023/09/15 15:00:00", 2, 127702, "2023/12/22 14:59:59", -470.0, 1, 2002, 2, 0.0, 2, "リンド");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10006, "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", 0.0, "2023/09/15 15:00:00", 2, 127702, "2023/12/22 14:59:59", -470.0, 2, 2002, 2, 0.0, 2, "リンド");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10007, "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", 0.0, "2023/09/15 15:00:00", 1, 127802, "2023/12/22 14:59:59", -470.0, 1, 2002, 1, 0.0, 2, "ヴルム");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10008, "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", 0.0, "2023/09/15 15:00:00", 2, 127802, "2023/12/22 14:59:59", -470.0, 2, 2002, 1, 6.5, 2, "ヴルム");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10009, "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", 0.0, "2023/12/15 15:00:00", 2, 129602, "2024/03/22 14:59:59", -470.0, 1, 2002, 1, 0.0, 3, "アネモネ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10010, "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", 0.0, "2023/12/15 15:00:00", 2, 129602, "2024/03/22 14:59:59", -470.0, 2, 2002, 1, 0.0, 3, "アネモネ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10011, "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", 0.0, "2023/12/15 15:00:00", 1, 129701, "2024/03/22 14:59:59", -470.0, 1, 2002, 1, 0.0, 3, "ネフィ=ネラ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10012, "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", 0.0, "2023/12/15 15:00:00", 2, 129701, "2024/03/22 14:59:59", -470.0, 2, 2002, 1, 6.2, 3, "ネフィ=ネラ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10013, "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", 0.0, "2024/03/15 15:00:00", 3, 130301, "2024/06/22 14:59:59", -470.0, 1, 2002, 5, 3.1, 4, "カノン");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10014, "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", 0.0, "2024/03/15 15:00:00", 3, 130301, "2024/06/22 14:59:59", -470.0, 2, 2002, 2, 6.15, 4, "カノン");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10015, "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", 0.0, "2024/03/15 15:00:00", 2, 130401, "2024/06/22 14:59:59", -470.0, 1, 2002, 2, 0.0, 4, "ナーナ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10016, "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", 0.0, "2024/03/15 15:00:00", 2, 130401, "2024/06/22 14:59:59", -470.0, 2, 2002, 1, 3.35, 4, "ナーナ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10017, "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", 0.0, "2024/06/15 15:00:00", 1, 130502, "2024/09/22 14:59:59", -470.0, 1, 2002, 1, 0.0, 5, "ホウオウ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10018, "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", 0.0, "2024/06/15 15:00:00", 2, 130502, "2024/09/22 14:59:59", -470.0, 2, 2002, 1, 3.18, 5, "ホウオウ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10019, "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", 0.0, "2024/06/15 15:00:00", 4, 130503, "2024/09/22 14:59:59", -470.0, 3, 2002, 4, 0.0, 5, "ホウオウ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10020, "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", 0.0, "2024/06/15 15:00:00", 1, 123301, "2024/09/22 14:59:59", -470.0, 1, 2002, 2, 4.9, 5, "ネア");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10021, "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", 0.0, "2024/06/15 15:00:00", 1, 123301, "2024/09/22 14:59:59", -470.0, 2, 2002, 2, 4.8, 5, "ネア");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10022, "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", 0.0, "2024/09/15 15:00:00", 3, 133301, "2024/12/22 14:59:59", -470.0, 1, 2002, 1, 4.922, 6, "カリザ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10023, "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", 0.0, "2024/09/15 15:00:00", 3, 133301, "2024/12/22 14:59:59", -470.0, 2, 2002, 5, 9.638, 6, "カリザ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10024, "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", 0.0, "2024/09/15 15:00:00", 1, 133401, "2024/12/22 14:59:59", -470.0, 1, 2002, 2, 2.88, 6, "ミーア");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10025, "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", 0.0, "2024/09/15 15:00:00", 5, 133401, "2024/12/22 14:59:59", -470.0, 2, 2002, 1, 4.818, 6, "ミーア");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10026, "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", 0.0, "2024/12/15 15:00:00", 2, 133002, "2025/03/22 14:59:59", -470.0, 1, 2002, 1, 1.78, 7, "グレイス");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10027, "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが", 0.0, "2024/12/15 15:00:00", 1, 133002, "2025/03/22 14:59:59", -470.0, 2, 2002, 7, 6.15, 7, "グレイス");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10028, "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？", 0.0, "2024/12/15 15:00:00", 6, 133102, "2025/03/22 14:59:59", -470.0, 1, 2002, 2, 4.28, 7, "ヴァイオレット");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10029, "じめじめした商品は\nございませんので\n安心してお買い求め下さい", 0.0, "2024/12/15 15:00:00", 1, 133102, "2025/03/22 14:59:59", -470.0, 2, 2002, 1, 0.0, 7, "ヴァイオレット");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10030, "いらっしゃいましぇでしゅ\n何をお求めでしゅか？\nたこ焼きもありましゅよ！", 0.0, "2025/03/15 15:00:00", 2, 136902, "2025/06/23 14:59:59", -470.0, 1, 2002, 1, 5.53, 8, "ルルィ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10031, "そのコイン…ピカピカで、\n集めたくなっちゃいましゅ\nタコ釣られされちゃう～…", 0.0, "2025/03/15 15:00:00", 9, 136902, "2025/06/23 14:59:59", -470.0, 2, 2002, 7, 6.05, 8, "ルルィ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10032, "姫のご友人ならば\n礼儀を尽くすのが爺の務め\nさ、望みの物を言いたまえ", 0.0, "2025/03/15 15:00:00", 2, 137001, "2025/06/23 14:59:59", -470.0, 1, 2002, 1, 0.0, 8, "デュラン");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10033, "キャラバンコインではなく\n首で支払って貰えんかのぅ\n…冗談であるぞ？", 0.0, "2025/03/15 15:00:00", 2, 137001, "2025/06/23 14:59:59", -470.0, 2, 2002, 1, 0.0, 8, "デュラン");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10034, "おう\n好きなもん持ってきな", 0.0, "2025/06/16 15:00:00", 2, 135902, "2025/09/23 14:59:59", -470.0, 1, 2002, 2, 0.0, 9, "サツキ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10035, "宵越しの銭を持つような\n野暮いマネぁしくさんな\nツキが落ちてもしらねぇぜ", 0.0, "2025/06/16 15:00:00", 1, 135902, "2025/09/23 14:59:59", -470.0, 2, 2002, 6, 4.935, 9, "サツキ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10036, "ら、ら、らっしゃっせ…\nなんかほしいもん、ある？\nか、かき氷とか、ど…？", 0.0, "2025/06/16 15:00:00", 2, 135802, "2025/09/23 14:59:59", -470.0, 1, 2002, 5, 7.441, 9, "ユキノ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10037, "そ、そんな見ねぇで…\nあては、売りもんじゃ\nねぇよ…？", 0.0, "2025/06/16 15:00:00", 7, 135802, "2025/09/23 14:59:59", -470.0, 2, 2002, 7, 0.0, 9, "ユキノ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10038, "クルルをお求めですかっ？\nそれならお礼に、こちらの\n宝石もどうぞですよ～♪", 0.0, "2025/09/16 15:00:00", 2, 130901, "2025/12/23 14:59:59", -470.0, 1, 2002, 2, 2.295, 10, "クルル");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10039, "はっ！　ヒーローさんから\nお代なんて頂けないです！\nどうぞどうぞ…え、ダメ？", 0.0, "2025/09/16 15:00:00", 1, 130901, "2025/12/23 14:59:59", -470.0, 2, 2002, 6, 6.281, 10, "クルル");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10040, "よぅ！　今日の俺さまは\n門番じゃなく、店番だぜ\nメモピ～スフィア～てな！", 0.0, "2025/09/16 15:00:00", 2, 137701, "2025/12/23 14:59:59", -470.0, 1, 2002, 1, 5.549, 10, "ヴォルガーノ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10041, "…リマさんのブロマイド？\n買い取るに決まってらぁ！\nなんでも持ってけ泥棒っ！", 0.0, "2025/09/16 15:00:00", 3, 137701, "2025/12/23 14:59:59", -470.0, 2, 2002, 6, 2.64, 10, "ヴォルガーノ");
